Y no habrá terceras

El suicidio, no sólo el asesinato como sostenía Thomas de Quincey, también debería incluirse entre las bellas artes. Lo de asfixiarse en doce horas de Comité Federal es una modalidad cruelmente sofisticada. En la categoría de suicidio colectivo pocas veces se ha escenificado algo tan espectacular; quizá sólo el festín de cianuro de 900 fieles de la secta Templo del Pueblo en Guyana. A pesar de actuar a puerta cerrada, las filtraciones vía Twitter mantenían la tensión del aquelarre, como si no tuvieran claros sus estatutos pero al menos sí las leyes del espectáculo: The show must go on. De buena mañana Rufián ironizaba: «¡Que comiencen el septuagésimo Comité Federal del PSOE», con una imagen de Effie Trinket; al caer la tarde, la parodia de Temboury de 'Lucha a muerte...' se quedaría corta. En política puedes hacer casi todo, menos el ridículo.
Sánchez, desde el anuncio del calendario de primarias y congreso, se proponía mantener su hoja de ruta con una estrategia calculada para imponer su relato: 'Rajoy sí vs. Rajoy no'. Con eso tenía ganada a la militancia, como se escenificó ayer en el escrache del exterior. Si rebajas un asunto complejo a un nivel mísero, ya no cabrá la razón. Por supuesto se trataba de una trampa: la situación en este pulso no era 'Rajoy sí vs. Rajoy no'; sino la deriva del partido, o sea, 'Sánchez sí vs. Sánchez no'. Una parte del partido forzó este maremágnum para desautorizar a la dirección no ya por bloquear la gobernabilidad de España, sino por hacerlo en una operación personalista poniendo en riesgo al PSOE con un pacto de hechos consumados que incluyera independentistas o terceras elecciones sin resuello. Tras meses de dudas, la operación resultó chapucera. Por eso no ha ganado una alternativa, sólo se ha logrado una victoria pírrica cuyo balance es un partido muy autodestruido.
Ya estaba escrito, en este Mar de Fondo, que lo de Sánchez&Luena sólo podía acabar como Thelma&Louise: en esa huida hacia delante a la desesperada no cabía la marcha atrás, sólo el abismo. Pero, entretanto, la credibilidad del PSOE ha agotado su reserva. Difícilmente pueden ofrecerse a dialogar con otros quienes no están en condiciones de dialogar ni con ellos mismos. Esos que gritaban «tejeros» y «fascistas», en un paseíllo intimidatorio, retrataban el error tóxico de la estrategia de Sánchez. Dentro, claro, no era distinto. El Partido Socialista no está en condiciones de liderar un Gobierno, no ya desde la debilidad de 85 escaños, sino desde la debilidad moral de lo sucedido. Con esa ruptura interna, la hipótesis de servir de vínculo entre Podemos y Ciudadanos, o con los independistas, es irrisoria. Esas once horas desde el 'No' a Rajoy al 'No' a Sánchez, sin acordar qué votar o quién votaría y cómo, entre mentiras y trampas -lograron que la CUP pareciera un modelo- pasará factura por largo tiempo.
Ya no habrá terceras elecciones. Incluso Sánchez difícilmente hubiera ido en diez semanas a la urnas -la fortuna ayuda los audaces, pero castiga la temeridad- tras el bochornoso guirigay de ayer. El precio de la operación de los críticos para desactivar esa bomba de relojería es muy alto. Sánchez ya era un político amortizado, pero Susana Díaz, Su Susanísima, puede haber quemado su tiempo en esta pira. En todo caso, el envenenamiento de la militancia con el «Rajoy sí/Rajoy no» tardará en curar. El socialismo español va a nutrir a Podemos aunque de momento España vuelve al eje centro derecha, con el espacio esencial del PSOE en barbecho. Sólo el PASOK tenía peor balance que el PSOE en Europa; pero no hay que descartar, tras lo del sábado, que su cataclismo se pueda superar.
Sólo pido una cosa al próximo dirigente. Que no nos machaque los oídos en cada acto público con lo de compañeros y compañeras y amigos y amigas. Tengan piedad de los televidentes. Dejemos las infantilidades de la correción política gramatical absurda que dan una imagen bastante pobre.
Se ha impuesto la sensatez y la cordura de los que abogan por aceptar la escándalosa derrota del PSOE en la urnas y sacar de una vez a España del bloqueo ante el radicalismo, el sectarismo, el revanchismo y el odio de Pedro Sánchez y sus fieles. Gracias críticos. Habéis salvado a España.
